window.bookSummaryJSON = "<p>Love is impossible. Hate is an open game.</p> <p><b>Kimberly</b></p> <p>He was once my best friend, now he’s my worst enemy.</p> <p>Xander Knight is heartbreakingly beautiful.</p> <p>Ridiculously popular.</p> <p>Brutally cruel.</p> <p>He’s a knight, but won’t do any saving.</p> <p><b>Xander</b></p> <p>We started as a dream, now we’re a nightmare.</p> <p>Kimberly Reed is pathetically fake.</p> <p>Terribly innocent.</p> <p>Secretly black.</p> <p>She can hide but never from me. </p> <p><i>Black Knight</i> is part of Royal Elite Series but could be listened to on its own. For better understanding of the world, you might want to check out the previous books first. This is a high school bully romance, mature new adult, and contains visceral mental health situations that some listeners can find triggering. </p>"; 
